import React from "react";
import { Map, GoogleApiWrapper } from "google-maps-react";

const GoogleMap = props => {
  return (
    <Map
      google={this.props.google}
      zoom={14}
      stlye={styles}
      initialCenter={{
        lat: -1.2884,
        lng: 36.6233
      }}
    />
  );
};

const styles = {
  width: "100%",
  height: "100%"
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyDszS9vH_VpB6mumst6qwxOXfOAIqpcXpg"
})(GoogleMap);
